  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0123639 contains oceanographic
  and surface meteorological data in netCDF formatted files, which follow the Climate
  and Forecast metadata convention (CF) and the Attribute Convention for Data Discovery
  (ACDD). University of Wisconsin-Milwaukee collected the data from station ATW20,
  an in-situ moored station, in the Great Lakes. GLOS, which assembles data from University
  of Wisconsin-Milwaukee and other sub-regional coastal and ocean observing systems
  of the Great Lakes region of the United States, submitted the data to NCEI as part
  of the Integrated Ocean Observing System Data Assembly Centers (IOOS DACs) Data
  Stewardship Program. Each month, NCEI adds to the Accession the data collected during
  the previous month.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
